import { isValidCredential } from "./isValidCredential";
import { resetAjvInstance } from "../../ajv/ajvInstance";
import { base64url } from "jose";
import { MDLValidationError } from "./MDLValidationError";

describe("isValidCredential", () => {
  beforeEach(() => {
    resetAjvInstance();
  });

  it("should return true for a valid credential", async () => {
    expect(await isValidCredential(valid)).toBe(true);
  });

  it("should throw MDLValidationError for invalid base64url encoding", async () => {
    expect.assertions(2);
    try {
      await isValidCredential("invalid@base64url!");
    } catch (error) {
      expect(error).toBeInstanceOf(MDLValidationError);
      expect((error as Error).message).toBe(
        "Failed to decode base64url encoded credential - The input to be decoded is not correctly encoded.",
      );
    }
  });

  it("should throw MDLValidationError for invalid CBOR encoding", async () => {
    expect.assertions(2);
    try {
      await isValidCredential(base64url.encode("invalidCbor"));
    } catch (error) {
      expect(error).toBeInstanceOf(MDLValidationError);
      expect((error as Error).message).toBe(
        "Failed to decode CBOR encoded credential - Extra data in input",
      );
    }
  });

  it("should throw MDLValidationError when an IssuerSignedItem is not tagged with tag 24", async () => {
    expect.assertions(2);
    try {
      await isValidCredential(missingTag24InTitle);
    } catch (error) {
      expect(error).toBeInstanceOf(MDLValidationError);
      expect((error as Error).message).toBe(
        "Failed to validate tags - IssuerSignedItem in namespace 'org.iso.18013.5.1.GB' missing tag '24'",
      );
    }
  });

  it("should throw MDLValidationError when 'expiry_date' is not tagged with tag 1004", async () => {
    expect.assertions(2);
    try {
      await isValidCredential(missingTag1004InExpiryDate);
    } catch (error) {
      expect(error).toBeInstanceOf(MDLValidationError);
      expect((error as Error).message).toBe(
        "Failed to validate tags - 'expiry_date' missing tag '1004'",
      );
    }
  });

  it("should throw MDLValidationError when 'issue_date' in driving privileges is not tagged with tag 1004", async () => {
    expect.assertions(2);
    try {
      await isValidCredential(missingTag1004InDrivingPrivilegeIssueDate);
    } catch (error) {
      expect(error).toBeInstanceOf(MDLValidationError);
      expect((error as Error).message).toBe(
        "Failed to validate tags - 'issue_date' in 'driving_privileges' missing tag '1004'",
      );
    }
  });

  it("should throw MDLValidationError when 'signed' in validity info is not tagged with tag 0", async () => {
    expect.assertions(2);
    try {
      await isValidCredential(missingTag0InValidityInfo);
    } catch (error) {
      expect(error).toBeInstanceOf(MDLValidationError);
      expect((error as Error).message).toBe(
        "Failed to validate tags - 'signed' in 'ValidityInfo' missing tag 0",
      );
    }
  });

  it("should throw MDLValidationError when the number of IssuerSignedItem elements is not 18 (missing 'family_name')", async () => {
    expect.assertions(2);
    try {
      await isValidCredential(missingFamilyName);
    } catch (error) {
      expect(error).toBeInstanceOf(MDLValidationError);
      expect((error as Error).message).toBe(
        "IssuerSigned does not comply with schema - /nameSpaces/org.iso.18013.5.1: must NOT have fewer than 18 items",
      );
    }
  });

  it("should throw MDLValidationError when one of the IssuerSignedItem contains an unknown element identifier (identifier is 'first_name' instead of 'given_name')", async () => {
    expect.assertions(2);
    try {
      await isValidCredential(hasUnknownProperty);
    } catch (error) {
      expect(error).toBeInstanceOf(MDLValidationError);
      expect((error as Error).message).toBe(
        "IssuerSigned does not comply with schema - /nameSpaces/org.iso.18013.5.1/1/elementIdentifier: must be equal to one of the allowed values",
      );
    }
  });

  it("should throw MDLValidationError when digestID in IssuerSignedItem is not an integer", async () => {
    expect.assertions(2);
    try {
      await isValidCredential(nonIntegerDigestId);
    } catch (error) {
      expect(error).toBeInstanceOf(MDLValidationError);
      expect((error as Error).message).toBe(
        "IssuerSigned does not comply with schema - /nameSpaces/org.iso.18013.5.1.GB/2/digestID: must be integer",
      );
    }
  });

  it("should throw MDLValidationError when digest IDs within the org.iso.18013.5.1 namespace are not unique", async () => {
    expect.assertions(2);
    try {
      await isValidCredential(nonUniqueDigestIdInISONamespace);
    } catch (error) {
      expect(error).toBeInstanceOf(MDLValidationError);
      expect((error as Error).message).toBe(
        "Digest IDs are not unique for namespace org.iso.18013.5.1",
      );
    }
  });

  it("should throw MDLValidationError when digest IDs within the org.iso.18013.5.1.GB namespace are not unique", async () => {
    expect.assertions(2);
    try {
      await isValidCredential(nonUniqueDigestIdInGBNamespace);
    } catch (error) {
      expect(error).toBeInstanceOf(MDLValidationError);
      expect((error as Error).message).toBe(
        "Digest IDs are not unique for namespace org.iso.18013.5.1.GB",
      );
    }
  });

  it("should throw MDLValidationError when portrait first byte is invalid", async () => {
    expect.assertions(2);
    try {
      await isValidCredential(invalidFirstPortraitByte);
    } catch (error) {
      expect(error).toBeInstanceOf(MDLValidationError);
      expect((error as Error).message).toBe(
        "Invalid SOI - JPEG should start with ffd8ffe0 or ffd8ffee or ffd8ffdb for JPEG but found ffd8ffe1",
      );
    }
  });

  it("should throw MDLValidationError when portrait last byte is invalid", async () => {
    expect.assertions(2);
    try {
      await isValidCredential(invalidLastPortraitByte);
    } catch (error) {
      expect(error).toBeInstanceOf(MDLValidationError);
      expect((error as Error).message).toBe(
        "Invalid EOI - JPEG should end with ffd9 but found e000",
      );
    }
  });

  it("should throw MDLValidationError when protected header is not a Map", async () => {
    expect.assertions(2);
    try {
      await isValidCredential(protectedHeaderNotMap);
    } catch (error) {
      expect(error).toBeInstanceOf(MDLValidationError);
      expect((error as Error).message).toBe("Protected header is not a Map");
    }
  });

  it("should throw MDLValidationError when protected header has more than one key", async () => {
    expect.assertions(2);
    try {
      await isValidCredential(protectedHeaderAdditionalKeys);
    } catch (error) {
      expect(error).toBeInstanceOf(MDLValidationError);
      expect((error as Error).message).toBe(
        "Protected header contains unexpected extra parameters - must contain only one",
      );
    }
  });

  it("should throw MDLValidationError when protected header is missing algorithm (1) key", async () => {
    expect.assertions(2);
    try {
      await isValidCredential(protectedHeaderMissingAlgorithm);
    } catch (error) {
      expect(error).toBeInstanceOf(MDLValidationError);
      expect((error as Error).message).toBe(
        'Protected header missing "alg" (1)',
      );
    }
  });

  it("should throw MDLValidationError when protected header algorithm is not ES256 (-1)", async () => {
    expect.assertions(2);
    try {
      await isValidCredential(protectedHeaderInvalidAlgorithm);
    } catch (error) {
      expect(error).toBeInstanceOf(MDLValidationError);
      expect((error as Error).message).toBe(
        'Protected header "alg" must be -7 (ES256)',
      );
    }
  });

  it("should throw MDLValidationError when unprotected header has more than one key", async () => {
    expect.assertions(2);
    try {
      await isValidCredential(unprotectedHeaderAdditionalKeys);
    } catch (error) {
      expect(error).toBeInstanceOf(MDLValidationError);
      expect((error as Error).message).toBe(
        "Unprotected header contains unexpected extra parameters - must contain only one",
      );
    }
  });

  it("should throw MDLValidationError when unprotected header is missing x5chain (33) key", async () => {
    expect.assertions(2);
    try {
      await isValidCredential(unprotectedHeaderMissingCertificate);
    } catch (error) {
      expect(error).toBeInstanceOf(MDLValidationError);
      expect((error as Error).message).toBe(
        'Unprotected header missing "x5chain" (33)',
      );
    }
  });

  it("should throw MDLValidationError when unprotected header certificate is not valid X509 certificate", async () => {
    expect.assertions(2);
    try {
      await isValidCredential(unprotectedHeaderInvalidCertificate);
    } catch (error) {
      expect(error).toBeInstanceOf(MDLValidationError);
      expect((error as Error).message).toEqual(
        expect.stringContaining("Failed to parse as X509Certificate"),
      );
    }
  });

  it("should throw MDLValidationError when MSO is missing required key 'docType'", async () => {
    expect.assertions(2);
    try {
      await isValidCredential(msoMissingDocType);
    } catch (error) {
      expect(error).toBeInstanceOf(MDLValidationError);
      expect((error as Error).message).toBe(
        "MobileSecurityObject does not comply with schema - root: must have required property 'docType'",
      );
    }
  });

  it("should throw MDLValidationError when IssuerSignedItem digest ID is not present in MSO digests", async () => {
    expect.assertions(2);
    try {
      await isValidCredential(missingDigestId);
    } catch (error) {
      expect(error).toBeInstanceOf(MDLValidationError);
      expect((error as Error).message).toBe(
        "No digest found for digestID 424551723 in MSO namespace org.iso.18013.5.1.GB: 1,424551688,424551653",
      );
    }
  });

  it("should throw MDLValidationError when digests don't match", async () => {
    expect.assertions(2);
    try {
      await isValidCredential(mismatchedDigest);
    } catch (error) {
      expect(error).toBeInstanceOf(MDLValidationError);
      expect((error as Error).message).toBe(
        'Digest mismatch for element identifier "birth_date with digest ID 424551863 in namespace org.iso.18013.5.1 - Expected b138461ea75caa226d557637cae764b54f13346969a8f8806fa4716de19c5c06 but calculated b138461ea75caa226d557637cae764b54f13346969a8f8806fa4716de19c5c05',
      );
    }
  });
});

